class Author {
  constructor(id, name, born, dead, location, url) {
    this.id = id;
    this.url = url;
    this.name = name;
    this.born = born;
    this.dead = dead;
    this.location = location;
    this.about =
      "Adib 1941 yil Toshkent viloyatining Zangiota (hozirgi Chilonzor) tumanidagi Doʻmbiravot mavzeida tugʻildi. Oʻ. Hoshimov mehnat faoliyatini erta boshladi. Toshkent Davlat universiteti (hozirgi Oʻzbekiston Milliy universiteti)ning jurnalistika kulliyotida oʻqish bilan baravar gazeta tahririyatida ishladi. 1959 yildan 1963 yilgacha “Temiryoʻlchi”, “Qizil Oʻzbekiston”, “Transportniy rabochiy” gazetalarida xat tashuvchi, mussaxhih, tarjimon boʻlib ishladi. Soʻng “Toshkent haqiqati” gazetasida adabiy xodim (1963–1966), “Toshkent oqshomi” gazetasida boʻlim mudiri (1966–1982), Gʻ. Gʻulom nomidagi Adabiyot va sanʼat nashriyotida bosh muharrir oʻrinbosari (1982–1985) boʻldi. 1985–1995 yillarda “Sharq yulduzi” jurnaliga bosh muharrirlik qildi. 1995 yildan 2005 yilgacha Oʻzbekiston Respublikasi Oliy Majlisining Matbuot va axborot qoʻmitasi raisi lavozimida ishladi. 2005 yildan “Teatr“ jurnalida bosh muharrir boʻlib ishladi.";
    this.info =
      "Yozuvchining ilk asari 1962-yilda „Poʻlat chavandoz“ nomida ocherklar toʻplami tarzida nashrdan chiqdi. Ammo yozuvchiga muvaffaqiyat keltirgan asar 1970-yilda nashr qilingan „Bahor qaytmaydi“ qissasi boʻldi.";
    this.read = Math.round(Math.random() * 100);
    this.listen = Math.round(Math.random() * 100);
  }
}

class Book {
  constructor(id, name, url) {
    this.id = id;
    this.url = url;
    this.name = name;
    this.page = Math.round(Math.random() * 1000);
    this.price = Math.round(Math.random() * 100);
    this.ball = Math.round(Math.random() * 10);
    this.comment = Math.round(Math.random() * 10000);
    this.audioLength = `${Math.round(Math.random() * 10)}:${Math.round(
      Math.random() * 100
    )}`;
    // Janre
    this.j = [
      "Fantastika",
      "Roman",
      "Ilmiy",
      "Diniy",
      "Aventure",
      "Tarixiy",
      "Tarbiyaviy",
      "Antiutopiya",
      "Detektiv",
    ];
    this.janre = () => {
      for (let i = 0; i < this.j.length - 2; i++) {
        if (Math.round(Math.random() * 10) === i) {
          return this.j[i];
        }
      }
    };

    // Publisher
    this.publish = [
      "Nihol Nashr",
      "Sharq",
      "Yangi asr avlodi",
      "Diyor",
      "Sadoi Mardum",
      "Najot",
      "Yangi O`zbekiston",
      "O`zbekiston ovozi",
      "Meros",
      "Xalq so`zi",
    ];
    this.publisher = () => {
      for (let i = 0; i < this.publish.length - 2; i++) {
        if (Math.round(Math.random() * 10) === i) {
          return this.publish[i];
        }
      }
    };
  }
}

